import React, { useEffect, useState } from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import { FaChartLine, FaUsers, FaStar, FaFutbol } from 'react-icons/fa';
import MatchCard from '../components/cards/MatchCard';
import PlayerCard from '../components/cards/PlayerCard';
import { getRecentMatches, getTopPlayers } from '../services/api';

const Dashboard = () => {
  const [recentMatches, setRecentMatches] = useState([]);
  const [topPlayers, setTopPlayers] = useState([]);

  useEffect(() => {
    const fetch = async () => {
      try {
        const mRes = await getRecentMatches({ limit: 6 });
        const pRes = await getTopPlayers({ limit: 6 });
        setRecentMatches(mRes.data || []);
        setTopPlayers(pRes.data || []);
      } catch (err) {
        console.error(err);
      }
    };
    fetch();
  }, []);

  return (
    <Container className="py-4">
      <Row className="mb-4">
        <Col md={3} className="mb-3">
          <Card className="futstats-card text-center h-100">
            <Card.Body className="stat-card">
              <FaChartLine size="3rem" color="var(--primary)" />
              <div className="stat-number">500K+</div>
              <div className="stat-label">Datos en Tiempo Real</div>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3} className="mb-3">
          <Card className="futstats-card text-center h-100">
            <Card.Body className="stat-card">
              <FaFutbol size="3rem" color="var(--primary)" />
              <div className="stat-number">15+</div>
              <div className="stat-label">Ligas Globales</div>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3} className="mb-3">
          <Card className="futstats-card text-center h-100">
            <Card.Body className="stat-card">
              <FaUsers size="3rem" color="var(--primary)" />
              <div className="stat-number">8</div>
              <div className="stat-label">Jugadores Siguiendo</div>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3} className="mb-3">
          <Card className="futstats-card text-center h-100">
            <Card.Body className="stat-card">
              <FaStar size="3rem" color="var(--primary)" />
              <div className="stat-number">3</div>
              <div className="stat-label">Equipos Favoritos</div>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Row>
        <Col lg={6} className="mb-4">
          <Card className="futstats-card h-100">
            <Card.Header className="card-header-custom">
              <h5 className="mb-0"><FaFutbol className="me-2" /> Partidos Recientes</h5>
            </Card.Header>
            <Card.Body>
              {recentMatches.length === 0 && <div>No hay partidos (cargando o API sin respuesta)</div>}
              {recentMatches.map((m, i) => <MatchCard key={m.id || i} match={m} />)}
              <Button variant="primary" className="w-100 mt-3">Ver Todos los Partidos</Button>
            </Card.Body>
          </Card>
        </Col>

        <Col lg={6} className="mb-4">
          <Card className="futstats-card h-100">
            <Card.Header className="card-header-custom">
              <h5 className="mb-0"><FaChartLine className="me-2" /> Jugadores Destacados</h5>
            </Card.Header>
            <Card.Body>
              {topPlayers.length === 0 && <div>No hay jugadores (cargando o API sin respuesta)</div>}
              {topPlayers.map((p, i) => <PlayerCard key={p.id || i} player={p} />)}
              <Button variant="primary" className="w-100 mt-3">Explorar Jugadores</Button>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Dashboard;
